A-Men is a puzzle platformer with a very specific and slightly oldschool
vibe. The title was created for hardcore players, who like being
challenged by a game, but will also appeal to gamers, who feel nostalgic

A-Men was inspired by classic, well-known titles, such as Lemmings and
Lost Vikings. During your journey through the world of A-Men you will
visit 4 worlds and 40 levels

Contrary to current trends, we decided to go for clever and addictive
entertainment for hardcore players. Are you ready

